import ReactDOM from 'react-dom';
import Header from './components/header';
import JSON from './db.json';

class App extends Component {
    render(){
        return (
            <div>
                <Header />
            </div>
            )
    }
}

ReactDOM.render(<App/>, document.getElementById('root'));
